<!-- HTML for static distribution bundle build -->
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <title>Swagger UI</title>
    <link rel="stylesheet" type="text/css" href="https://rusbnbapi.exp-of-betrayal.repl.co/swagger-ui.css" />
    <link rel="stylesheet" type="text/css" href="index.css" />
    <link rel="icon" type="image/png" href="https://rusbnbapi.exp-of-betrayal.repl.co/favicon-32x32.png" sizes="32x32" />
    <link rel="icon" type="image/png" href="https://rusbnbapi.exp-of-betrayal.repl.co/favicon-16x16.png" sizes="16x16" />
  </head>

  <body>
    <div id="swagger-ui"></div>
    <script src="https://rusbnbapi.exp-of-betrayal.repl.co/swagger-ui-bundle.js" charset="UTF-8"> </script>
    <script src="https://rusbnbapi.exp-of-betrayal.repl.co/swagger-ui-standalone-preset.js" charset="UTF-8"> </script>
    <script charset="UTF-8"> //initialiser-swagger.js
      window.onload = function() {
      //<editor-fold desc="Changeable Configuration Block">

      window.ui = SwaggerUIBundle({
        url: "api",
        dom_id: '#swagger-ui',
        deepLinking: true,
        presets: [
          SwaggerUIBundle.presets.apis,
          SwaggerUIStandalonePreset
        ],
        plugins: [
          SwaggerUIBundle.plugins.DownloadUrl
        ],
        layout: "StandaloneLayout"
      });

      //</editor-fold>
    };
    </script>
  </body>
</html>
